import React from 'react';
import styled from 'styled-components';

const StyledAside = styled.aside`
  display: flex;
  flex-direction: column;
  align-items: space-evenly;
  background: #222222;
`;

const Button = styled.button`
  width: 53px;
  height: 177px;
  background: #e9ece6;
`;

export default function AsideButtons({ to }) {
  return (
    <StyledAside>
      <Button />
    </StyledAside>
  );
}
